import React from "react";
import { View, Text, Button } from "native-base";
import { useSelector, useDispatch } from "react-redux";




const Home = () => {


    const state = useSelector(state => state);

    return (
        <View>
        <Text>{state}</Text>
        <Button title="Test" onPress={console.log("store.getState()")}/>
        </View>
    )
}

export default Home
